import GlobalStyle from "../theme/GlobalStyle";

const Layout = (props) => (
  <>
    <GlobalStyle />
    <Head>
      <title>Stowarzyszenie Madness</title>
    </Head>
    <Navbar />
    <Header />
    <Calendar />
    {/* <Gallery /> */}
    {/* 
    <News />


    <Footer /> */}
  </>
);

export default Layout;
